import React from "react";

function GalleryPage() {
  return (
    <>
      <div className="text-white p-4 pl-20 text-xl">GalleryPage</div>
      {/* Categories of art: Portraits, Graphite, Charcoal, Color Pencil, Digital */}
      <div className="flex flex-row ">
        {["Portraits", "Graphite", "Charcoal", "Color Pencil", "Digital"].map(
          (category) => (
            <div key={category} className="text-white border-b  p-2">
              {category}
            </div>
          )
        )}
      </div>
      {/* Have a frame for each photo, a white window mat and the portrait in the center */}
    </>
  );
}

export default GalleryPage;
